    "I am ready to start this timed exam,": "\u0623\u0646\u0627 \u062c\u0627\u0647\u0632 \u0644\u0628\u062f\u0621 \u0627\u0644\u0627\u0645\u062a\u062d\u0627\u0646 \u0627\u0644\u0645\u0648\u0642\u0648\u062a",
